// SPDX-License-Identifier: MIT
// Beef MarketPlace Contracts v0.0.0 hello@mcdu.com

pragma solidity ^0.8.0;

import "./BytesAndKeccakLib.sol";

contract KeccakInverter {
    using BytesAndKeccakLib for bytes32[];
    using BytesAndKeccakLib for bytes;

    mapping(bytes32 => bytes) private _keccakinverted;

    function exists(bytes32 k_) public view virtual returns (bool) {
        return _keccakinverted[k_].length != 0;
    }
    function equal(
        bytes memory t1_,
        bytes memory t2_
    ) private pure returns (bool) {
        if (t1_.length!=t2_.length)
            return false;
        for (uint i;i<t1_.length;i++)
            if (t1_[i]!=t2_[i])
                return false;
        return true;
    }

    function Bytes(bytes memory in_) public virtual returns (bytes32 k_) {
        k_ = keccak256(in_);
        if (_keccakinverted[k_].length == 0) 
            _keccakinverted[k_] = in_;
        else 
        {
            require(equal(_keccakinverted[k_],in_),"KeccakInverter Bytes keccak isnt unique !!!!!!!!!!!!");
            // PARANOIA
            //while (!equal(_keccakinverted[k_],in_))
            //    k_ = bytes32(uint256(k_)+1);
        }
    }


    function String(string memory in_) public virtual returns (bytes32 k_) {
        return Bytes(bytes(in_));
    }



    function Bytes32Array(bytes32[] memory in_) public virtual returns (bytes32 k_) {
        return Bytes(in_.Bytes32ArrayToBytes());
    }



    function AddressUInt256(address addr_, uint256 v_)
        public virtual
        returns (bytes32 k_)
    {
        return Bytes32Array(BytesAndKeccakLib.AddressUInt256ToBytes32Array(addr_, v_));
    }




    function Bytes32Address(bytes32 v_, address addr_)
        public virtual
        returns (bytes32 k_)
    {
        return Bytes32Array(BytesAndKeccakLib.Bytes32AddressToBytes32Array(v_, addr_));
    }



    function Bytes32Bytes32(bytes32 v1_, bytes32 v2_)
        public virtual
        returns (bytes32 k_)
    {
        return Bytes32Array(BytesAndKeccakLib.Bytes32Bytes32ToBytes32Array(v1_, v2_));
    }

    function resolveBytes(bytes32 k_) public view returns (bytes memory out_) {
        return _keccakinverted[k_];
    }

    function resolveString(bytes32 k_)
        public
        view
        virtual
        returns (string memory out_)
    {
        return string(_keccakinverted[k_]);
    }


    function resolveBytes32Array(bytes32 k_)
        public
        view virtual
        returns (bytes32[] memory out_)
    {
        return resolveBytes(k_).BytesToBytes32Array();
    }


    function resolveAddressUInt256(bytes32 k_)
        public
        view virtual
        returns (address addr_, uint256 v_)
    {
        return resolveBytes32Array(k_).Bytes32ArrayToAddressUInt256();
    }



    function resolveBytes32Address(bytes32 k_)
        public
        view virtual
        returns (bytes32 v_, address addr_)
    {
        return resolveBytes32Array(k_).Bytes32ArrayToBytes32Address();
    }

    function resolveBytes32Bytes32(bytes32 k_)
        public
        view virtual
        returns (bytes32 v1_, bytes32 v2_)
    {
        return resolveBytes32Array(k_).Bytes32ArrayToBytes32Bytes32();
    }
}
